import { Resource } from '@src/types';

export interface HubspotProperty {
  name: string;
  label: string;
  value: string;
  type: HubspotPropertyType;
}

export enum HubspotPropertyType {
  Enumeration= 'enumeration',
  Number= 'number',
  Datetime = 'datetime',
  String = 'string',
}

export interface HubspotState {
  profiles: {
    [email: string]: Resource<HubspotContactProfile>;
  };
}

export interface HubspotContactProfile {
  tickets: HubspotData[];
  deals: HubspotData[];
  companies: HubspotData[];
  details: HubspotDetail;
}

export interface HubspotData {
  createdAt: Date;
  updatedAt: Date;
  archived: boolean;
  id: string;
  details: HubspotDetail;

}

export interface HubspotDetail {
  createdAt: Date;
  updatedAt: Date;
  archived: boolean;
  id: string;
  url: string;
  properties: HubspotProperty[];
}
